def word_contains(word, letter):
    # counts number of instances of letter in word
    count = 0
    for l in word:
        if l == letter:
            count += 1
    return count

def duplicate_letters(word):
    # returns list of all letters that appear more than once in a word in form (letter, index)
    res = []
    for i in range(len(word)):
        letter = word[i]
        if word_contains(word, letter) > 1:
            # if not res:
            res.append((letter, (i)))
            # else:
            #     for j in range(len(res)):
            #         res[res.index(letter)][2].append(j)

    if not res:
        return None
    else:
        return res


def rescore(list_of_words):
    fn = ".wordle_temp.txt"
    f = open(fn, 'w')
    list_of_words = [str(i[0]) + '\n' for i in list_of_words]
    f.writelines(list_of_words)
    f.close()
    freqdata = frequency_analysis(fn)
    returndict = build_dict(fn, freqdata)
    return sorted(returndict, key=lambda x: x[1])


